import { connect } from 'react-redux';
import { Link } from 'react-router-dom';


function Navbar() {
    return(
      <nav className='w-full py-10 fixed shadow-md'>
          <div className="bg-white px-4 sm:px-6">
              <div className="-ml-4 -mt-2 flex flex-wrap items-center justify-between sm:flex-nowrap md:px-14 px-2">
                  <div className="ml-4 mt-2">
                    <h3 className="text-lg font-medium leading-6 text-gray-900">Job Postings</h3>
                  </div>
                    <div className="ml-4 mt-2 flex-shrink-0">
                    <Link className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-4">Cases</Link>
                    <Link className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-4">Services</Link>
                    <Link className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-4">About Us</Link>
                    <Link className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-4">Blog</Link>
                    <Link className="text-lg inline-flex font-medium leading-6 text-gray-900 mx-4">Contact</Link>
                    <button
                      type="button"
                      className="ml-12 relative inline-flex items-center rounded-md border border-transparent bg-indigo-600 px-4 py-2 text-sm font-medium text-white shadow-sm hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2">
                      Create new job
                    </button>
                  </div>
              </div>
          </div>
      </nav>
    )
}

const mapStateToProps = state =>({

})

export default connect(mapStateToProps, {

}) (Navbar);
